import React from 'react';
import propic from './propic.JPG';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={propic} className="App-propic" alt="propic" />
        <div className="jumbotron" id="mainbody">
          <h1 className="display-4">eirene</h1>
          <p className="lead">full-stack software engineer</p>
          <p>hello! my name is eirene lakshita, and i'm an Atlanta-based '</p>
          <a className="btn btn-primary btn-lg" href="https://github.com/eirenelakshita" role="button">GitHub</a>
        </div>
      </header>
    </div>
  );
}

export default App;
